import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>AI Growth Backlog Generator</h1>
        <p>Generate and prioritize growth initiatives for your business</p>
      </header>
      <main>
        <p>Welcome to the AI Growth Backlog Generator!</p>
        <p>This application will help you create and prioritize growth initiatives.</p>
      </main>
    </div>
  );
}

export default App;
